Parses.Sparql:
#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
  ?x ns:sports.sports_championship_event.championship ns:m.0hn79
  {
    ?x ns:sports.sports_championship_event.champion ns:m.0j6tr . # Toronto Maple Leafs
  }
  UNION
  {
    ?x ns:sports.sports_championship_event.runner_up ns:m.0j6tr . # Toronto Maple Leafs
  }
  ?x ns:time.event.start_date ?st .
}
ORDER BY DESC(xsd:datetime(?st))
LIMIT 1
